import React from "react";
import "../styles/who-i-work-with.css";

const WhoIworkWith = () => (
    <div className = "who-i-work-with">
        <div className = "who-i-work-with-title">
            Who I work With
        </div>
        <div className = "who-i-work-with-item"> <div></div> Adult Performers and Content Creators</div>
        <div className = "who-i-work-with-item"> <div></div> Social Media Influencers</div>
        <div className = "who-i-work-with-item"> <div></div> Musicians</div>
        <div className = "who-i-work-with-item"> <div></div> YouTube and Twitch Creators</div>
        <div className = "who-i-work-with-item"> <div></div> Digital Artists & Photographers</div>
        <div className = "who-i-work-with-item"> <div></div> Small To Large Businesses</div>
    </div>
)

export default WhoIworkWith;
